export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`If you’re a Redis user who prefers to use a Graphical User Interface(GUI) for graph queries, then RedisInsight is a right tool for you. It’s 100% free pure desktop Redis GUI that provides easy-to-use browser tools to query, visualize and interactively manipulate graphs. You can add new graphs, run queries and explore the results over the GUI tool.`}</p>
    <p>{`RedisInsight supports `}<a parentName="p" {...{
        "href": "https://oss.redislabs.com/redisgraph/"
      }}>{`RedisGraph`}</a>{` and allows you to:`}</p>
    <ul>
      <li parentName="ul">{`Build and execute queries`}</li>
      <li parentName="ul">{`Navigate your graphs`}</li>
      <li parentName="ul">{`Browse, analyze, and export results`}</li>
      <li parentName="ul">{`Keyboard shortcuts to zoom`}</li>
      <li parentName="ul">{`Button to reset view; center entire graph`}</li>
      <li parentName="ul">{`Zoom capability via mouse wheel(Double right-click to zoom out, Double right-click to zoom out.)`}</li>
      <li parentName="ul">{`Ability to copy commands with a button click`}</li>
      <li parentName="ul">{`Ability to persist nodes display choices between queries`}</li>
    </ul>
    <p>{`As a benefit, you get faster turnarounds when building your application using Redis and RedisGraph.`}</p>
    <p>{`Follow the below steps to see how your data is connected via the RedisInsight Browser tool.`}</p>
    <h2 {...{
      "id": "step-1-create-redis-database"
    }}>{`Step 1. Create Redis database`}</h2>
    <p><a parentName="p" {...{
        "href": "https://developer.redislabs.com/howtos/redisgraph"
      }}>{`Follow this link to create a Redis database`}</a>{` using Redis Enterprise Cloud with RedisGraph module enabled`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-2-download-redisinsight"
    }}>{`Step 2: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"
`}<img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <p>{`Enter the requested details, including Name, Host (endpoint), Port, and Password.  Then click “ADD REDIS DATABASE”.`}</p>
    <h2 {...{
      "id": "step-3-click-redisgraph-and-then-add-graph"
    }}>{`Step 3: Click “RedisGraph” and then “Add Graph”`}</h2>
    <p>{`Select RedisGraph from the menu.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image2.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-4-create-a-new-graph-called-friends"
    }}>{`Step 4. Create a new Graph called “Friends”`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image3.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-5-add-new-nodesindividuals-and-links"
    }}>{`Step 5. Add new nodes(individuals) and links`}</h2>
    <p>{`Let us add individuals to the graph. CREATE is used to introduce new nodes and relationships.Run the below cypher query on RedisInsight GUI to add a label called person and property called “name”.`}</p>
    <pre><code parentName="pre" {...{}}>{`CREATE (:Person{name:"Tom" }),  (:Person{name:"Alex" }), (:Person{name:"Susan" }), (:Person{name:"Bill" }), (:Person{name:"Jane" })
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image4.png").default} title="image_tooltip" /></p>
    <p>{`As we see that “1” label is added and that refers to a person label. It’s the same for every node and hence created once. Overall there are 5 nodes created. The five “name” properties refer to 5 name properties that have been added.`}</p>
    <h2 {...{
      "id": "step-6-view-all-the-individuals-nodes"
    }}>{`Step 6: View all the individuals (nodes)`}</h2>
    <p>{`Match describes the relationship between queried entities, using ascii art to represent pattern(s) to match against. Nodes are represented by parentheses () , and Relationships are represented by brackets [] .`}</p>
    <p>{`As shown below, we have added lowercase “p” in front of our label and is a variable we can make a reference to. It returns all the nodes with a label called “Person”.`}</p>
    <pre><code parentName="pre" {...{}}>{`MATCH (p:Person) RETURN p
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image5.png").default} title="image_tooltip" /></p>
    <p>{`You can select "Graph View" on the right menu to display the graphical representation as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image6.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-7-viewing-just-one-individualnode"
    }}>{`Step 7. Viewing just one individual(node)`}</h2>
    <pre><code parentName="pre" {...{}}>{`MATCH (p:Person {name:"Tom"}) RETURN p
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image7.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-8-visualize-the-relationship-between-the-individuals"
    }}>{`Step 8: Visualize the relationship between the individuals`}</h2>
    <p>{`Run the below query to build a relationship between two nodes and how the relationship flows from one node(“Tom”) to the another node(“Alex”).`}</p>
    <pre><code parentName="pre" {...{}}>{`MATCH (p1:Person {name: "Tom" }), (p2:Person {name: "Alex" }) CREATE (p1)-[:Knows]->(p2)
`}</code></pre>
    <p>{`The symbol “>” (greater than) shows which way the relationship flows.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image8.png").default} title="image_tooltip" /></p>
    <p>{`You can view the relationship in the form of graph as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image9.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-9-create-and-visualize-the-multiple-relationships"
    }}>{`Step 9. Create and visualize the multiple relationships`}</h2>
    <p>{`Run the below query to create and visualize relationsship between the multiple individuals `}</p>
    <pre><code parentName="pre" {...{}}>{`MATCH (p1:Person {name: "Tom" }), (p2:Person {name: "Susan" }), (p3:Person {name: "Bill" }) CREATE (p1)-[:Knows]->(p2), (p1)-[:Knows]->(p3)
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image10.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-10-create-and-visualize-the-relationship-between-two-individuals-susan-and-bill"
    }}>{`Step 10. Create and visualize the relationship between two individuals (Susan and Bill)`}</h2>
    <p>{`Let us look at how to generate graph showcasing the relationship between two individuals - Susan and Bill`}</p>
    <pre><code parentName="pre" {...{}}>{`MATCH (p1:Person {name: "Susan"}), (p2:Person {name: "Bill"}) CREATE (p1)-[:Knows]->(p2)
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image11.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-11-create-and-visualize-the-relationship-between-two-indiviual-bill-and-jane"
    }}>{`Step 11. Create and visualize the relationship between two indiviual (Bill and Jane)`}</h2>
    <pre><code parentName="pre" {...{}}>{`MATCH (p1:Person {name: "Bill"}), (p2:Person {name: "Jane"}) CREATE (p1)-[:Knows]->(p2)
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image12.png").default} title="image_tooltip" /></p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image13.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-12-building-a-social-networking"
    }}>{`Step 12. Building a social networking`}</h2>
    <p>{`This can be achieved by “friend of friends” kind of relationship. Say, If Tom wanted to social network with Jane. He has two contacts that know Jane - one is Susan and the other person is Bill.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image14.png").default} title="image_tooltip" /></p>
    <pre><code parentName="pre" {...{}}>{`MATCH p = (p1:Person {name: "Tom" })-[:Knows*1..3]-(p2:Person {name: "Jane"}) RETURN p
`}</code></pre>
    <p>{`In this query, we assign a variable “p” to a node graph path. We search for “Tom” as p1 and “Jane” as “p2”. We say interested in knows link with 1..3 degree of separation.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image15.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-13-cleaning-up-the-graph"
    }}>{`Step 13. Cleaning up the Graph`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image16.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "importing-the-bulk-graph-data"
    }}>{`Importing the Bulk Graph data`}</h2>
    <p>{`Let us try to insert bulk data using Python and then extrapolate it in the form of nodes and relationships.`}</p>
    <h2 {...{
      "id": "step-14-cloning-the-repository"
    }}>{`Step 14. Cloning the repository**`}</h2>
    <pre><code parentName="pre" {...{}}>{`$ git clone https://github.com/redis-developer/redis-datasets
cd redis-datasets/redisgraph/datasets/iceandfire
`}</code></pre>
    <h2 {...{
      "id": "step-15-execute-the-script"
    }}>{`Step 15. Execute the script`}</h2>
    <pre><code parentName="pre" {...{}}>{`$ python3 bulk_insert.py GOT_DEMO -n data/character.csv -n data/house.csv -n data/book.csv -n data/writer.csv -r data/wrote.csv -r data/belongs.csv -h 192.168.1.9 -p 6379



2124 nodes created with label 'b'character''
438 nodes created with label 'b'house''
12 nodes created with label 'b'book''
3 nodes created with label 'b'writer''
14 relations created for type 'b'wrote''
2208 relations created for type 'b'belongs''
Construction of graph 'GOT_DEMO' complete: 2577 nodes created, 2222 relations created in 0.169954 seconds


`}</code></pre>
    <h2 {...{
      "id": "step-16-run-the-cypher-query"
    }}>{`Step 16. Run the cypher query`}</h2>
    <pre><code parentName="pre" {...{}}>{`GRAPH.QUERY GOT_DEMO "MATCH (w:writer)-[wrote]->(b:book) return w,b"
`}</code></pre>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image18.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "additional-resources"
    }}>{`Additional Resources`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://oss.redislabs.com/redisgraph/"
        }}>{`RedisGraph Project`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/slowlog"
        }}>{`Slowlog Configuration using RedisInsight`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/memoryanalyzer"
        }}>{`Memory Analysis using RedisInsight`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/browser"
        }}>{`Visualize Redis database keys using RedisInsight Browser Tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/streams"
        }}>{`Using Redis Streams with RedisInsight`}</a></li>
    </ul>
    </MDXLayout>;
}

;
